import React from "react";
import { Route, Routes, Link } from "react-router-dom";
import Login from "../pages/auth/Login";
import Register from "../pages/auth/Register";
import Dashboard from "../pages/dashboard";
import "../styles/global.css";

const App = () => {
  return (
    <div>
      <p>App</p>
    </div>
  );
};

const Home = () => {
  return (
    <div>
      <p>Home</p>
    </div>
  );
};

const Teams = () => {
  return (
    <div>
      <p>Header</p>
      <div className="mt-2">
        <nav>
          <Link to="/teams/new">create new</Link> |
          <Link to="/teams/:id">Update</Link>
        </nav>
        <div className="mt-10">
          <Routes>
            <Route exact path="teams/new" element={<NewTeamForm />} />
            <Route exact path="teams/:id" element={<Team />} />
          </Routes>
        </div>
        <div className="mt-2">
          <p>Footer</p>
        </div>
      </div>
    </div>
  );
};

const Team = () => {
  return (
    <div>
      <p>Team</p>
    </div>
  );
};

const NewTeamForm = () => {
  return (
    <div>
      <p>New team</p>
    </div>
  );
};

const LeagueStandings = () => {
  return (
    <div>
      <p>halaman index</p>
    </div>
  );
};

const Router = () => {
  return (
    <div>
      <nav>
        <Link to="/">App</Link> | <Link to="home">Home</Link> |{" "}
        <Link to="teams">Teams</Link>
      </nav>
      <div className="mt-10">
        <Routes>
          <Route exact path="/" element={<App />} />
          <Route exact path="/home" element={<Home />} />
          <Route exact path="/teams" element={<Teams />} />

          <Route path="*" element={<h1>Not found page</h1>} />
        </Routes>
      </div>
    </div>
  );
};

export default Router;
